import React from 'react';
import './CardGrande.css'
import * as C from 'styled'

function CardGrande(props) {
    return (
        <C.BigcardContainer>
            <C.BigcardImg src={ props.imagem } />
            <C.BigcardInicio>
                <C.BigcardH4>{ props.nome }</C.BigcardH4>
                <p>{ props.descricao }</p>
            </C.BigcardInicio>
        </C.BigcardContainer>
    )
}

export default CardGrande;
